import React from 'react';
import { useNavigate } from 'react-router-dom';

const mystyle = {
    color: 'tomato', 
    fontSize: "25px", 
    fontFamily: "serif",
  }

const Contact = () => {
	let navigate = useNavigate();
	return (
		<div style={mystyle}>
			<h1>Contact</h1>
			<button
				type="button"
				className="btn btn-primary"
				onclick={() => {
					navigate("/about")
				}}
			>
				Back to Homepage
			</button>
		</div>
	);
};

export default Contact;
